import { TabsContainer, CampaingsPageContainer, ContentContainer } from './styles'
import { useEffect, useState } from 'react'
import CampaingModel from '../../models/campaing'
import { User } from '../../models/user'
import { loadCampaing } from '../../services'
import SummaryCard from '../../components/CampaingElements/SummaryCard'
import Tab from '../../components/Tab'
import { useParams } from 'react-router-dom'

interface Props {
  user?: User []
}

const CampaingPage = ({ user }: Props) => {
  const [campaing, setCampaing] = useState<CampaingModel[]>()
  const { idCampaing } = useParams()

  useEffect(() => {
    if(user) {
      loadCampaing(Number(idCampaing), user[0].accessToken)
      .then(resp => {
        console.log(resp)
        //setCampaing(resp.data)
      })
      .catch(error => {
        console.log(error)
      })
    }
  }, [user, idCampaing])

  return (
    <CampaingsPageContainer>
      <TabsContainer>
        <Tab text='Taboola' isSelected={true} onClick={() => {}} />
      </TabsContainer>

      <ContentContainer>
        {campaings? (
          campaings.map((campaing, index) => (
            <SummaryCard key={index} id={campaing.id} name={campaing.name} user={user} />
          ))
        ) : (
          'Nenhuma campanha foi criada até o momento.'
        )}
      </ContentContainer>
    </CampaingsPageContainer>
  )
}

export default CampaingPage
